import React, { useState, useCallback } from 'react';
import { Form, Table } from 'antd';
import styled from 'styled-components';

const CenterDiv = styled.div`
    width: 50%;
    margin : 0 auto;
    margin-tom: 20px;
`;

const EditUser = () => { 
    return (
        <Form>
            <CenterDiv>
                <Table>
                    <Table.Column title="Bucket List" dataInex="bucket" key="bucket" />
                    <Table.Column title="Delete" dataInex="delete" key="delete" />
                </Table>
            </CenterDiv>
        </Form>
    );
}

export default EditUser;
